    render() {
        console.log(styles)
        return (
            <div className={styles.mealListContainer}>
                <ul className={styles.mealList}>
                    {this.props.meals.map((meal, index) => 
                        <div key={meal.index} class="panel panel-warning">
                            <div class="panel-heading">{meal.name}</div>
                            <div class="panel-body"><AddIngredients meal={meal} /></div>
                        </div>
                        // <li key={meal.index}>
